import './App.css';

function App() {
  const firstName = "First Name";
  const lastname = "Last Name";
  const currentDate = new Date().toGlobalDateString();
  const currentTime = new Date().toGlobalTimeString();
  // const time = new Time();
  return (
      <div className="App">
        <h1>Demo One | {firstName} {lastname}</h1>
        <p>Today day is: {currentDate}</p>
        <p>Current Time is: {currentTime}</p>
      </div>
  );
}

export default App;
